Build a scraper using this configuration:
{
  "name": "Legislative Calendar Scraper",
  "startUrl": "https://www.honolulu.gov/clerk/clk-council-calendar/",
  "pageStructures": [
    {
      "fields": [
        {
          "fieldName": "time",
          "selectorSteps": [
            {
              "selector": "div.em-item-meta-line.em-event-time"
            }
          ]
        },
        {
          "fieldName": "date",
          "selectorSteps": [
            {
              "selector": "div.em-item-meta-line.em-event-date"
            }
          ]
        },
        {
          "fieldName": "name",
          "selectorSteps": [
            {
              "selector": "div.em-modal-title > a"
            }
          ]
        },
        {
          "fieldName": "name-note",
          "selectorSteps": [
            {
              "selector": "This and the rest of the following fields are inside the event, you have to click the single event for this information to popup on the screen"
            }
          ]
        },
        {
          "fieldName": "agenda_url",
          "selectorSteps": [
            {
              "selector": "a > span > strong"
            }
          ]
        },
        {
          "fieldName": "docket_url",
          "selectorSteps": [
            {
              "selector": "a > span > strong"
            }
          ]
        }
      ],
      "itemSelector": "div.em-cal-event > div"
    }
  ]
}
